import React from 'react';
import {
  Container,
  Grid,
  IconButton,
  Typography
} from '@material-ui/core';
import {
  Language as WebIcon,
  Settings as SettingsIcon
} from '@material-ui/icons';

export default function WebControlContainer(){
  return(
    <Container>
      <Grid container>
        <WebIcon />
        <Typography>Web</Typography>
      </Grid>
      <Grid container>
        <Typography>Protection level: High</Typography>
        <IconButton>
          <SettingsIcon />
        </IconButton>
      </Grid>
    </Container>
  );
};
